import React from "react";
import styled from "styled-components";

const Container = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  margin: 0 auto;
`;
const Title = styled.h1`
  color: black;
`;
export default () => {


const base_path = "api.giphy.com";
  const API_KEY : string = "nFAEP18e84RVowk1BMRDJ8WE6mi2xVFp"


  const fetchWrapper = async (url: string, params: any) => {
    const token = localStorage.getItem(API_KEY);
    const response = await fetch(url, {
      ...params,
      headers: {
        ...params.headers,
        Authorization: `Bearer ${token}`,
        Accept: "application/json",
        "Content-Type": "application/json",
      },
    });
    if (response.status >= 200 && response.status <= 299) {
      return response;
    }
    const responseBody = await response.json();
    console.log(response.status, responseBody)
  };


  return (
    <div>
      <Container>
        <Title>Api Connected Website</Title>
      </Container>
    </div>
  );
};
